import React from "react";
import Card1 from "../components/card";
import Boostrap from "../imagenes/MySql.png"

function Skills(){
  return(
    <div className="m-20">
      <div className=" flex text-5xl justify-center pb-10"> Programming Languages & Frameworks most used</div>
      <div className="grid grid-cols-6 ">
        <Card1
        image={Boostrap} 
        />
        <label for="disabled-range" className="block mb-2 text-sm font-medium text-gray-900 dark:text-gray-300">Default range</label>
        <input id="disabled-range" type="range" value="50" className="w-full h-2 bg-gray-200 rounded-lg appearance-none cursor-pointer dark:bg-gray-700" disabled></input>
        <svg class="w-5 h-5 text-yellow-400" fill="currentColor" viewBox="0 0 20 20" xmlns="http://www.w3.org/2000/svg"><path d="M9.049 2.927c.3-.921 1.603-.921 1.902 0l1.07 3.292a1 1 0 00.95.69h3.462c.969 0 1.371 1.24.588 1.81l-2.8 2.034a1 1 0 00-.364 1.118l1.07 3.292c.3.921-.755 1.688-1.54 1.118l-2.8-2.034a1 1 0 00-1.175 0l-2.8 2.034c-.784.57-1.838-.197-1.539-1.118l1.07-3.292a1 1 0 00-.364-1.118L2.98 8.72c-.783-.57-.38-1.81.588-1.81h3.461a1 1 0 00.951-.69l1.07-3.292z"></path></svg>

      </div>

    </div>
  )
}

export default Skills;

